// ==UserScript==
// @run-at document-start
// @name        Google Logo Restorer
// @version     1.3
// @description Restores the previous Google logo and favicon
// @author      Knowbody
// @include     /^https?://[a-z]+\.google(\.com?)?\.[a-z]{2,3}/.*$/
// @include     /^https?://webcache\.googleusercontent\.com.*$/
// @exclude	    /^https?://(chrome|apis|mail|accounts|support|maps|play|news|drive|translate|plus)\.google\..*$/
// @exclude     https://www.google.com/recaptcha/api2/*
// @license     GPL version 3 or any later version; http://www.gnu.org/copyleft/gpl.html
// @namespace   https://greasyfork.org/users/11757
// ==/UserScript==

var googleLogo = 'data:image/png;base64,';
var googleLogo2 = 'data:image/png;base64,';
var navLogo = 'data:image/png;base64,';
var favIcon = 'data:image/x-icon;base64,';

sessionStorage.setItem('favIcon', favIcon);

new MutationObserver(swapLogo).observe(document, {childList:true, subtree:true});
new MutationObserver(replaceFavIcon).observe(document, {childList:true, subtree:true});

function replaceFavIcon() {
    var notReplaced = true;
    var headLinks = document.head.getElementsByTagName('link');
    for (let link of headLinks) {
        if (link.rel == 'shortcut icon') {
            link.href = sessionStorage.getItem('favIcon');
            notReplaced = false;
            break;
        }
    }
    if (notReplaced) {
        var favIcon = document.createElement('link');
        favIcon.rel = 'shortcut icon';
        favIcon.href = sessionStorage.getItem('favIcon');
        document.head.insertBefore(favIcon, document.head.firstChild);
    }
}

function swapLogo() {
    // Chrome New Tab Page
    if (location.protocol=='chrome-search:') {
        lga = document.getElementById("lga");
        if (lga && lga.children[0]) {
            lga.children[0].src = googleLogo;
        }
    }
    // Search pages
    else if (location.search) {            
        logo = document.getElementById('logo');
        if (logo)
            // non-IE user agent
            if (logo.children[0])
                if (logo.children[0].height>400) logo.children[0].src = navLogo;
                else if (logo.children[0].height<=130) logo.children[0].src = googleLogo2;
            // IE user agent
            else if (logo.style.backgroundImage) logo.style.backgroundImage = 'url("'+navLogo+'")';
        // Page navigation ==
        csb = document.getElementsByClassName("csb");
        for (var i in csb)
            if (csb[i].style) csb[i].style.backgroundImage = 'url("'+navLogo+'")';
    }
    // Main page
    else {
        hplogo = document.getElementById('hplogo');
        if (hplogo) {
            if (hplogo.srcset) hplogo.srcset = googleLogo;
            // google.com
            else if (hplogo.src) hplogo.src = googleLogo;
            // International
            else if (hplogo.style) {
                hplogo.style.background = 'url("'+googleLogo+'")';
                hplogo.style.backgroundImage = 'url("'+googleLogo+'")';
            }
        }
    }
}